import React, { Component } from 'react'
import '../style.css';

function List(props) {
    return (
        <div>
            <img alt="example" src={props.link} style={{ width: "20px", height: "20px" }} />
            <a href={props.link1}>
                <p>@{props.nama}</p>
            </a>
        </div>
    )
}

export default class Instagram extends Component {
    render() {
        const background = {
            backgroundColor: this.props.bgcolor,
        };
        return (
            <div className="wrapper">
            <div className="row">

            </div>
                
            </div>
        );
    }
}
